import React from 'react';

const Menu = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-4">
          <div className="card">
            <ul className="list-group list-group-flush">
              <li className="list-group-item">Edit Profile</li>
              <li className="list-group-item">View Chats</li>
              <li className="list-group-item">Logout</li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Menu;
